import React, {useEffect} from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import NavBar from "./components/NavBar";
import Home from "./pages/home";
import BannerManager from "./pages/main/BannerManager";
import PopupManager from "./pages/main/PopupManager";
import ScheduleManager from "./pages/main/ScheduleManager";
import Notice from "./pages/notice";
import ShopManager from "./pages/shopManager";
import SuggestionManager from "./pages/communication/SuggestionManager";
import AskManager from "./pages/communication/AskManager";
import AskAnswer from "./pages/communication/AskAnswer"
import SuggestionAnswer from "./pages/communication/SuggestionAnswer"
import ClubUnion from "./pages/dataCollection/ClubUnion";
import ElectionCommittee from "./pages/dataCollection/ElectionCommittee";
import StudentCouncil from "./pages/dataCollection/StudentCouncil";
import AdminPermissions from "./pages/members/AdminPermissions";
import MemberManager from "./pages/members/MemberManager";
import Setting from "./pages/setting/SettingPage";
import styled from "styled-components";
import BannerRegister from "./components/Banner_Components/BannerRegister"
import Redirect from "./API/AuthApi";
import DataRegister from "./components/DataCollection_Components/DataRegister";
import ShopDataRegister from "./components/Shop_Components/ShopDataRegister";
import Popupregister from "./components/Popup_Components/popupregister";
import CreateNoticePage from "./pages/notice/CreateNoticePage";

const AppContainer = styled.div`
  display: flex;
  height: 100vh;
`;

const NavBarContainer = styled.div`
  width: 15vw;
  background-color: rgba(30, 30, 44, 1);
`;

const MainContent = styled.div`
  flex: 1;
  overflow-y: auto;
  /* padding: 20px; */
`;

function App() {
  useEffect(() => {
    // Retrieve the token from an API or from wherever you get it
    const tokenValue = '4/0AZEOvhXGPq3nOz7IdhK9Hq8V9fXkLlj6gMYSeurFcLGyTsshEgNbltxT-xLAfKw7QGVSkQ';

    // Save the token in localStorage
    localStorage.setItem('token', tokenValue);
  }, []);
  return (
    <Router>
      <AppContainer>
        <NavBarContainer>
          <NavBar />
        </NavBarContainer>
        <MainContent>
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/main/banner" element={<BannerManager />} />
            <Route path="/main/popup" element={<PopupManager />} />
            <Route path="/main/schedule" element={<ScheduleManager />} />
            <Route path="/notice" element={<Notice />} />
            <Route path="/notice/create" element={<CreateNoticePage />} />
            <Route path="/shopManager" element={<ShopManager />} />
            <Route path="/shopManager/shopRegister" element={<ShopDataRegister />} />
            <Route path="/communication/suggestion" element={<SuggestionManager />} />
            <Route path="/communication/suggestion/:id" element={<SuggestionAnswer />} />
            <Route path="/communication/ask" element={<AskManager />} />
            <Route path="/communication/ask/:id" element={<AskAnswer />} />
            <Route path="/dataCollection/clubUnion" element={<ClubUnion />} />
            <Route path="/dataCollection/electionCommittee" element={<ElectionCommittee />} />
            <Route path="/dataCollection/studentCouncil" element={<StudentCouncil />} />
            <Route path="/members/adminPermissions" element={<AdminPermissions />} />
            <Route path="/members/memberManager" element={<MemberManager />} />
            <Route path="/setting" element={<Setting />} />
            <Route path="/bannerRegister" element={<BannerRegister />} />
            <Route path="/Popupregister" element={<Popupregister/>} />
            <Route path="/dataRegister" element={<DataRegister />} />
            <Route path="/login/oauth/google" element={<Redirect />} />

          </Routes>
        </MainContent>
      </AppContainer>
    </Router>
  );
}

export default App;
